package leetcode.Monthly.May.FindAnagrams;

import java.util.ArrayList;
import java.util.HashMap;
import java.util.List;

public class FindAnagrams3 {
    public static void main(String[] args) {
        FindAnagrams3 findAnagrams = new FindAnagrams3();
        findAnagrams.findAnagrams("cbaebabacd", "abc");
        findAnagrams.findAnagrams("abab", "ab");
        findAnagrams.findAnagrams("baa", "aa");
        findAnagrams.findAnagrams(
                "",
                "");
//        System.out.println("a" & "b" & "c");

        //s: "cbaebabacd" p: "abc"
    }


    public List<Integer> findAnagrams(String s, String p) {
        List<Integer> output = new ArrayList<>();
        boolean isAnalgam = false;
        char[] sChar = s.toCharArray();
        char[] pChar = p.toCharArray();
        HashMap<Character, Integer> temp = new HashMap<>();
        for (int i = 0; i < sChar.length - pChar.length + 1; i++) {
            isAnalgam = false;
            temp.clear();
            for (int l = 0; l < pChar.length; l++) {
                for (int k = i; k < pChar.length + i; k++) {
                    if (pChar[l] == sChar[k]) {
//                        if(temp.containsKey(pChar[l])){
                            if(temp.get(pChar[l])  != null && temp.get(pChar[l]) != k){
                                isAnalgam = true;
                                temp.put(pChar[l], k);
                                break;
//                            }
                        }else{
                            isAnalgam = true;
                            temp.put(pChar[l], k);
                            break;
                        }

                    } else {
                        isAnalgam = false;
                    }

                }
                if (!isAnalgam)
                    break;
            }
            if (isAnalgam)
                output.add(i);
        }

        return output;
    }

}
